import advancersPic from "../images/advancers.png";
import carbonprintPic from "../images/carbonprint1.png";
import civildiscordPic from "../images/civil-discord.png";
import flippoPic from "../images/flippo.png";
import ysePic from "../images/yse-light.png";
import shewhocodesPic from "../images/shewhocodes-light.png";

export const advancers = { banner: { advancersPic }, name: "Advancers.ai" };

export const carbonprint = { banner: { carbonprintPic }, name: "Carbonprint" };

export const civildiscord = {
  banner: { civildiscordPic },
  name: "Civil Discord",
};
